query FetchDrive($empaticoClassId: ID!) {
  empaticoDrive(empaticoClassId: $empaticoClassId) {
    folders: driveFolders {
      edges {
        node {

  id
  name
  lastActivityAt
  archivedAt

          files: driveFiles {
            edges {
              node {

  id
  description
  poster
  name
  lastActivityAt
  archivedAt
  classroomId
  createdAt

                asset {

  __typename
  ... on Video {

  id
  poster
  encodings

  }
  ... on Image {

  id
  path

  }

                }
              }
            }
          }
        }
      }
    }
  }
}

